import styled from "styled-components"
import CicleProgress from "./CicleProgress"
import ShareLine from "./ShareLine"


const Container = styled.div`
    font-family: WantedSans-Regular;
    margin-top : 40px;
    font-size : 16px;
    padding : 5px;
    background-color :red;

    justify-content : space-around;
`

const Range = styled.div`
display : flex;
flex-derection : row;
`

function Position() {

    return (
        <Container>
            <ShareLine title="Possible Postion" />
            <Range>
                <CicleProgress percent={100} title={"Back End"} />
                <CicleProgress percent={80} title={"Fornt End"} />
                <CicleProgress percent={50} title={"DevOps"} />
            </Range>

        </Container>
    )
}

export default Position
